import React from "react";
import {ResponsiveBar} from "@nivo/bar";

const data = [
  {
    "country": "AD",
    "hot dog": 135,
    "hot dogColor": "hsl(204, 70%, 50%)",
    "burger": 196,
    "burgerColor": "hsl(247, 70%, 50%)",
    "sandwich": 190,
    "sandwichColor": "hsl(330, 70%, 50%)",
    "kebab": 111,
    "kebabColor": "hsl(109, 70%, 50%)",
    "fries": 200,
    "friesColor": "hsl(302, 70%, 50%)",
    "donut": 185,
    "donutColor": "hsl(110, 70%, 50%)"
  },
  {
    "country": "AE",
    "hot dog": 21,
    "hot dogColor": "hsl(164, 70%, 50%)",
    "burger": 116,
    "burgerColor": "hsl(352, 70%, 50%)",
    "sandwich": 130,
    "sandwichColor": "hsl(219, 70%, 50%)",
    "kebab": 66,
    "kebabColor": "hsl(110, 70%, 50%)",
    "fries": 174,
    "friesColor": "hsl(36, 70%, 50%)",
    "donut": 0,
    "donutColor": "hsl(292, 70%, 50%)"
  },
  {
    "country": "AF",
    "hot dog": 17,
    "hot dogColor": "hsl(57, 70%, 50%)",
    "burger": 34,
    "burgerColor": "hsl(221, 70%, 50%)",
    "sandwich": 145,
    "sandwichColor": "hsl(48, 70%, 50%)",
    "kebab": 97,
    "kebabColor": "hsl(12, 70%, 50%)",
    "fries": 106,
    "friesColor": "hsl(66, 70%, 50%)",
    "donut": 189,
    "donutColor": "hsl(178, 70%, 50%)"
  },
  {
    "country": "AG",
    "hot dog": 42,
    "hot dogColor": "hsl(90, 70%, 50%)",
    "burger": 72,
    "burgerColor": "hsl(240, 70%, 50%)",
    "sandwich": 12,
    "sandwichColor": "hsl(253, 70%, 50%)",
    "kebab": 6,
    "kebabColor": "hsl(325, 70%, 50%)",
    "fries": 41,
    "friesColor": "hsl(17, 70%, 50%)",
    "donut": 0,
    "donutColor": "hsl(315, 70%, 50%)"
  },
  {
    "country": "AI",
    "hot dog": 152,
    "hot dogColor": "hsl(28, 70%, 50%)",
    "burger": 75,
    "burgerColor": "hsl(14, 70%, 50%)",
    "sandwich": 140,
    "sandwichColor": "hsl(136, 70%, 50%)",
    "kebab": 177,
    "kebabColor": "hsl(2, 70%, 50%)",
    "fries": 93,
    "friesColor": "hsl(209, 70%, 50%)",
    "donut": 15,
    "donutColor": "hsl(345, 70%, 50%)"
  },
  {
    "country": "AL",
    "hot dog": 118,
    "hot dogColor": "hsl(237, 70%, 50%)",
    "burger": 157,
    "burgerColor": "hsl(158, 70%, 50%)",
    "sandwich": 111,
    "sandwichColor": "hsl(223, 70%, 50%)",
    "kebab": 63,
    "kebabColor": "hsl(213, 70%, 50%)",
    "fries": 61,
    "friesColor": "hsl(22, 70%, 50%)",
    "donut": 61,
    "donutColor": "hsl(336, 70%, 50%)"
  },
  {
    "country": "AM",
    "hot dog": 105,
    "hot dogColor": "hsl(195, 70%, 50%)",
    "burger": 5,
    "burgerColor": "hsl(78, 70%, 50%)",
    "sandwich": 167,
    "sandwichColor": "hsl(88, 70%, 50%)",
    "kebab": 67,
    "kebabColor": "hsl(338, 70%, 50%)",
    "fries": 101,
    "friesColor": "hsl(324, 70%, 50%)",
    "donut": 196,
    "donutColor": "hsl(230, 70%, 50%)"
  }
];

const Testsgraph = () => {
	return (
		<div style={{maxHeight: "750px", width: "75%", aspectRatio: "16/9"}}>
		<ResponsiveBar
        data={data}
        keys={[ 'hot dog', 'burger', 'sandwich', 'kebab', 'fries', 'donut' ]}
        indexBy="country"
        margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
        padding={0.3}
        valueScale={{ type: 'linear' }}
        indexScale={{ type: 'band', round: true }}
        colors={{ scheme: 'nivo' }}
        defs={[
            {
                id: 'dots',
                type: 'patternDots',
                background: 'inherit',
                color: '#38bcb2',
                size: 4,
                padding: 1,
                stagger: true
            },
            {
                id: 'lines',
                type: 'patternLines',
                background: 'inherit',
                color: '#eed312',
                rotation: -45,
                lineWidth: 6,
                spacing: 10
            }
        ]}
        fill={[
            {
                match: {
                    id: 'fries'
                },
                id: 'dots'
            },
            {
                match: {
                    id: 'sandwich'
                },
                id: 'lines'
            }
        ]}
        borderColor={{ from: 'color', modifiers: [ [ 'darker', 1.6 ] ] }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'country',
            legendPosition: 'middle',
            legendOffset: 32
        }}
        axisLeft={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'food',
            legendPosition: 'middle',
            legendOffset: -40
        }}
        enableGridY={false}
        labelSkipWidth={12}
        labelSkipHeight={12}
        labelTextColor={{ from: 'color', modifiers: [ [ 'darker', 1.6 ] ] }}
        legends={[
            {
                dataFrom: 'keys',
                anchor: 'bottom-right',
                direction: 'column',
                justify: false,
                translateX: 120,
                translateY: 0,
                itemsSpacing: 2,
                itemWidth: 100,
                itemHeight: 20,
                itemDirection: 'left-to-right',
                itemOpacity: 0.85,
                symbolSize: 20,
                effects: [
                    {
                        on: 'hover',
                        style: {
                            itemOpacity: 1
                        }
                    }
                ]
            }
        ]}
        animate={true}
        motionStiffness={90}
        motionDamping={15}
    />
		</div>
		)
}

export default Testsgraph;
